import React, { Component } from "react";

type MainState = {
  title: string; // title of this main page
  videos: {
    // array of video objects to be displayed in VideoTiles
    thumbnailURI: string;
    title: string;
    artist: string;
    views: number;
    uploaded: string;
  }[];
};

type MainProps = {
  title: string; // title of this main page
  videos: {
    // array of video objects to be displayed in VideoTiles
    thumbnailURI: string;
    title: string;
    artist: string;
    views: number;
    uploaded: string;
  }[];
};

export default class Main extends Component<MainProps, MainState> {
  state: MainState = {
    title: this.props.title,
    videos: this.props.videos,
  };

  componentDidUpdate(prevProps: MainProps, prevState: MainState) {
    if (prevProps !== this.props) {
      this.setState(this.props);
    }
  }

  render() {
    return <div></div>;
  }
}
